// based on an expired UK passport
func TestPassiveAuthImportedDocBadDG2(t *testing.T) {
	// TODO - EF.COM is currently required by doc.Verify... but do we really need to enforce this?
	var com []byte = utils.HexToBytes("60145F0104303130375F36063034303030305C026175")
	var sod []byte = utils.HexToBytes("")
	var dg1 []byte = utils.HexToBytes("615B5F1F58503C47425253414E444552534F4E3C3C4F534341523C434841524C45533C4544574152443C3C3C3C3C3C3C3C30393932353036393236474252373830343035364D323230373137393C3C3C3C3C3C3C3C3C3C3C3C3C3C3032")
	// NB DG2 corrupted by changing last byte (D9-DA)
	var dg2 []byte = utils.HexToBytes("")
	var csca []byte = utils.HexToBytes("")

	var err error
	var doc document.Document

	doc.Mf.Lds1.Com, err = document.NewCOM(com)
	if err != nil {
		t.Fatalf("unexpected error (NewCOM): %s", err)
	}

	err = doc.NewDG(1, dg1)
	if err != nil {
		t.Fatalf("unexpected error (NewDG:1): %s", err)
	}

	err = doc.NewDG(2, dg2)
	if err != nil {
		t.Fatalf("unexpected error (NewDG:2): %s", err)
	}

	doc.Mf.Lds1.Sod, err = document.NewSOD(sod)
	if err != nil {
		t.Fatalf("unexpected error (NewSOD): %s", err)
	}

	err = doc.Verify()
	if err != nil {
		t.Fatalf("unexpected error (doc.Verify): %s", err)
	}

	var trustedCerts cms.GenericCertPool
	err = trustedCerts.Add(csca)
	if err != nil {
		t.Fatalf("unexpected error (trustedCerts.Add): %s", err)
	}

	// passive-auth should FAIL due to a corrupted DG2 (hash mismatch with SoD)
	err = PassiveAuth(&doc, &trustedCerts)
	if err == nil {
		t.Fatalf("expected error (PassiveAuth): %s", err)
	}
}

func TestAlpha2CountryCodeMismatchError(t *testing.T) {
	// NB SOD is for DE, and DG1 is for UK, so error is expected due to mismatch

	// UK
	var dg1 []byte = utils.HexToBytes("615B5F1F58503C47425253414E444552534F4E3C3C4F534341523C434841524C45533C4544574152443C3C3C3C3C3C3C3C30393932353036393236474252373830343035364D323230373137393C3C3C3C3C3C3C3C3C3C3C3C3C3C3032")
	// DE
	var sod []byte = utils.HexToBytes("")

	var err error
	var doc document.Document

	err = doc.NewDG(1, dg1)
	if err != nil {
		t.Fatalf("unexpected error (NewDG:1): %s", err)
	}

	doc.Mf.Lds1.Sod, err = document.NewSOD(sod)
	if err != nil {
		t.Fatalf("unexpected error (NewSOD): %s", err)
	}

	_, err = alpha2CountryCode(&doc)
	if err == nil {
		t.Fatalf("Error expected")
	}
}
